import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';

// Tạo các component tạm thời cho từng page (sẽ tách file sau)
function HomePage() {
  return <h2>Trang chủ - Danh sách sản phẩm</h2>;
}
function LoginPage() {
  return <h2>Đăng nhập</h2>;
}
function RegisterPage() {
  return <h2>Đăng ký</h2>;
}

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<HomePage />} />
        <Route path="/login" element={<LoginPage />} />
        <Route path="/register" element={<RegisterPage />} />
      </Routes>
    </Router>
  );
}

export default App;
